import React from 'react';
import { Typography, Paper } from '@mui/material';
import StorefrontOutlinedIcon from '@mui/icons-material/StorefrontOutlined';

const styles = {
  container: {
    padding: '2rem',
    display: 'flex',
    justifyContent: 'center',
  },
  paper: {
    width: '50%',
    backgroundColor: '#325636',
    display: 'flex', // Ensure the icon and text are displayed in a flex container
    alignItems: 'center', // Align items vertically to center them
  },
  title: {
    fontWeight: 'bold',
    color: '#FFFFFF',
    marginLeft: '1rem', // Add left margin to the title to create spacing between icon and text
  },
  icon: {
    marginLeft: '1rem', // Add left margin to the icon to position it at the most left side
  },
};

const PickupPage = () => {
  return (
    <div style={styles.container}>
      <Paper elevation={3} sx={styles.paper}>
        <StorefrontOutlinedIcon sx={styles.icon} /> {/* Apply styles to the icon */}
        <Typography variant='h5' sx={styles.title}>Store Details</Typography>
      </Paper>
    </div>
  );
};

export default PickupPage;
